define({"topics" : [{"title":"Importing Quality Center tests into a TestArchitect test module","shortdesc":"\n                     <p class=\"shortdesc\">Tests residing in <span class=\"ph\">Quality Center</span> can be imported into <span class=\"ph\">TestArchitect</span>. Each <span class=\"ph\">Quality Center</span> test is     mapped automatically to a test case in <span class=\"ph\">TestArchitect</span>.\n                     </p>\n                  ","id":"QC_test_development_step1","href":"TA_Help\/Topics\/Integration_QC_test_development_step_1.html","menu": {"hasChildren":false,},"tocID":"QC_test_development_step1-d46e23984","next":"QC_test_development_step1-d46e23984",},{"title":"Uploading TestArchitect test modules\/test cases to Quality Center","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> test modules and test cases can be     uploaded to <span class=\"ph\">Quality Center</span> which establishes one-to-one mappings between       <span class=\"ph\">TestArchitect</span> test cases and <span class=\"ph\">Quality Center</span> tests.\n                     </p>\n                  ","id":"QC_test_development_step2","href":"TA_Help\/Topics\/Integration_QC_test_development_step_2.html","menu": {"hasChildren":false,},"tocID":"QC_test_development_step2-d46e24047","next":"QC_test_development_step2-d46e24047",},{"title":"Test entity mappings","shortdesc":"\n                     <p class=\"shortdesc\">This topic describes how <span class=\"ph\">TestArchitect</span> test module and     test case fields and contents are mapped to <span class=\"ph\">Quality Center</span> tests,     determining how information is transferred during the import and upload processes.\n                     </p>\n                  ","id":"concept.ta_qc_mappings","href":"TA_Help\/Topics\/ug_QC_mapped_items.revised.html","menu": {"hasChildren":false,},"tocID":"concept.ta_qc_mappings-d46e24108","topics":[]},{"title":"Uploading test results to Quality Center","shortdesc":"\n                     <p class=\"shortdesc\">     <span class=\"ph\">TestArchitect</span> test results from projects which are mapped to <span class=\"ph\">Quality Center</span> can be uploaded to <span class=\"ph\">Quality Center</span>     manually or automatically.\n                     </p>\n                  ","id":"QC_uploading_results","href":"TA_Help\/Topics\/Integration_QC_Uploading_test_results_to_QC.html","menu": {"hasChildren":false,},"tocID":"QC_uploading_results-d46e24125","next":"QC_uploading_results-d46e24125",},{"title":"Executing tests from Quality Center","shortdesc":"\n                     <p class=\"shortdesc\">As an alternative to executing tests from <span class=\"ph\">TestArchitect</span>,       <span class=\"ph\">TestArchitect</span> test cases and test modules can be executed from       <span class=\"ph\">Quality Center</span>.\n                     </p>\n                  ","id":"QC_executing_test","href":"TA_Help\/Topics\/Integration_QC_executing_from_QC.html","menu": {"hasChildren":false,},"tocID":"QC_executing_test-d46e24181","topics":[]},{"title":"Creating matching custom fields in TestArchitect and Quality Center","shortdesc":"\n                     <p class=\"shortdesc\">User-defined fields in <span class=\"ph\">TestArchitect</span> are       automatically mapped to their counterparts in <span class=\"ph\">Quality Center</span>, when such       counterparts exist.\n                     </p>\n                  ","id":"QC_creating_custom_field","href":"TA_Help\/Topics\/Integration_QC_creating_mapping_custom_field.html","menu": {"hasChildren":false,},"tocID":"QC_creating_custom_field-d46e24201","next":"QC_creating_custom_field-d46e24201",}]});